import{_ as a,a as r,b as d,c as e,d as o,e as l,f as i}from"./chunks/radio-2.BVhjY8Cp.js";import{_ as s,c as n,a8 as h,o as p}from"./chunks/framework.BDnHobkS.js";const q=JSON.parse('{"title":"VOXL 2 Зоряний PX4 Розробка Дрону","description":"","frontmatter":{},"headers":[],"relativePath":"uk/complete_vehicles_mc/modalai_starling.md","filePath":"uk/complete_vehicles_mc/modalai_starling.md"}'),c={name:"uk/complete_vehicles_mc/modalai_starling.md"};function m(u,t,b,g,_,S){return p(),n("div",null,t[0]||(t[0]=[h('<h1 id="voxl-2-зорянии-px4-розробка-дрону" tabindex="-1">VOXL 2 Зоряний PX4 Розробка Дрону <a class="header-anchor" href="#voxl-2-зорянии-px4-розробка-дрону" aria-label="Permalink to &quot;VOXL 2 Зоряний PX4 Розробка Дрону&quot;">​</a></h1><p><a href="https://modalai.com/starling" target="_blank" rel="noreferrer">Starling</a> - це SLAM розроблений дрон, підсиленний <a href="./../flight_controller/modalai_voxl_2.html">VOXL 2</a> та PX4 з оптимізованими датчиками та навантаженнями для внутрішньої та зовнішньої автономної навігації. За допомогою автопілота Blue UAS Framework, VOXL 2, Starling важить всього 275 г і має вражаючі 30 хвилин автономного польоту в приміщенні.</p><p><img src="'+a+'" alt="Огляд"></p><p>VOXL 2 Starling - це розробницький безпілотник PX4, який містить супутній комп&#39;ютер <a href="./../flight_controller/modalai_voxl_2.html">VOXL 2</a> та керування польотом PX4, сенсори зображення, GPS, модем підключення і готовий до польоту прямо з коробки. Starling має <a href="https://docs.modalai.com/voxl-developer-bootcamp/" target="_blank" rel="noreferrer">відкрите SDK</a> від ModalAI, яке має попередньо налаштовані моделі автономії для польотів з допомогою комп&#39;ютерного зору. Цей розвивальний дрон призначений, щоб допомогти вам швидше вийти на ринок та прискорити розробку та прототипування вашої програми.</p><p>Цей посібник пояснює мінімальну додаткову настройку, необхідну для підготовки БПЛА до польоту. Він також охоплює огляд апаратного забезпечення, перший польот, налаштування WiFi та інше.</p><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Для повного та регулярно оновлюваного документування відвідайте <a href="https://docs.modalai.com/starling-v2" target="_blank" rel="noreferrer">https://docs.modalai.com/starling-v2</a>.</p></div><div class="info custom-block"><p class="custom-block-title">INFO</p><p>Якщо ви новачок у VOXL, обов&#39;язково ознайомтеся з основними функціями апаратного та програмного забезпечення VOXL, переглянувши <a href="https://docs.modalai.com/voxl-developer-bootcamp/" target="_blank" rel="noreferrer">VOXL Bootcamp</a>.</p></div><h2 id="де-купити" tabindex="-1">Де купити <a class="header-anchor" href="#де-купити" aria-label="Permalink to &quot;Де купити&quot;">​</a></h2><p><a href="https://modalai.com/starling" target="_blank" rel="noreferrer">modalai.com/starling</a></p><h2 id="налаштування-обладнання" tabindex="-1">Налаштування обладнання <a class="header-anchor" href="#налаштування-обладнання" aria-label="Permalink to &quot;Налаштування обладнання&quot;">​</a></h2><p><img src="'+r+'" alt="Огляд апаратної частини"></p><table tabindex="0"><thead><tr><th>Callout</th><th>Опис</th><th>MPN</th></tr></thead><tbody><tr><td>A</td><td>VOXL 2</td><td>MDK-M0054-1</td></tr><tr><td>B</td><td>VOXL 4-in-1 ESC</td><td>MDK-M0117-1</td></tr><tr><td>C</td><td>Заглушка для барометра</td><td>M10000533</td></tr><tr><td>D</td><td>Датчик зображення ToF (PMD)</td><td>MDK-M0040</td></tr><tr><td>E</td><td>Датчик відстеження зображень (OV7251)</td><td>M0014</td></tr><tr><td>F</td><td>Датчик зображення високої якості (IMX214)</td><td>M0025-2</td></tr><tr><td>G</td><td>AC600 WiFi Dongle</td><td>AWUS036EACS</td></tr><tr><td>H</td><td>Модуль GNSS GPS &amp; Компас</td><td>M10-5883</td></tr><tr><td>I</td><td>Приймач ELRS 915МГц</td><td>BetaFPV Nano RX</td></tr><tr><td>J</td><td>Роз&#39;єм USB C на VOXL 2 (не відображено)</td><td></td></tr><tr><td>K</td><td>Блок живлення VOXL</td><td>MCCA-M0041-5-B-T</td></tr><tr><td>L</td><td>4726FM Пропелер</td><td>M10000302</td></tr><tr><td>M</td><td>Мотор 1504</td><td></td></tr><tr><td>N</td><td>XT30 Конектор живлення</td><td></td></tr></tbody></table><h2 id="документація" tabindex="-1">Документація <a class="header-anchor" href="#документація" aria-label="Permalink to &quot;Документація&quot;">​</a></h2><h3 id="характеристики" tabindex="-1">Характеристики <a class="header-anchor" href="#характеристики" aria-label="Permalink to &quot;Характеристики&quot;">​</a></h3><table tabindex="0"><thead><tr><th>Компонент</th><th>Специфікація</th></tr></thead><tbody><tr><td>Автопілот</td><td>VOXL2</td></tr><tr><td>Максимальна взлітна вага</td><td>275г (172г без батареї)</td></tr><tr><td>Розмір по діагоналі</td><td>211мм</td></tr><tr><td>Час польоту</td><td>30 хвилин</td></tr><tr><td>Двигуни</td><td>1504</td></tr><tr><td>Пропелери</td><td>120mm</td></tr><tr><td>Frame</td><td>Карбонове волокно 3мм</td></tr><tr><td>ESC</td><td>ModalAI VOXL 4-in-1 ESC V2</td></tr><tr><td>GPS</td><td>UBlox M10</td></tr><tr><td>Приймач радіокерування</td><td>915мгц ELRS</td></tr><tr><td>Модуль живлення</td><td>Модуль живлення ModalAI v3 - 5V/6A</td></tr><tr><td>Батарея</td><td>Sony VTC6 3000mah 2S, або будь-яка 2S 18650 батарея з роз&#39;ємом XT30</td></tr><tr><td>Висота</td><td>83мм</td></tr><tr><td>Ширина</td><td>187мм (пропелери складені)</td></tr><tr><td>Довжина</td><td>142мм (пропелери складені)</td></tr></tbody></table><h3 id="стандартна-схема-проводки" tabindex="-1">Стандартна схема проводки <a class="header-anchor" href="#стандартна-схема-проводки" aria-label="Permalink to &quot;Стандартна схема проводки&quot;">​</a></h3><p><img src="'+d+'" alt="Огляд апаратної частини"></p><h2 id="посібники" tabindex="-1">Посібники <a class="header-anchor" href="#посібники" aria-label="Permalink to &quot;Посібники&quot;">​</a></h2><h3 id="elrs-set-up" tabindex="-1">ELRS Set Up <a class="header-anchor" href="#elrs-set-up" aria-label="Permalink to &quot;ELRS Set Up&quot;">​</a></h3><p>Прив&#39;язка вашого приймача ELRS (ExpressLRS) до передавача є важливим кроком у підготовці вашого набору розробника автономії PX4 Autonomy Developer Kit від ModalAI на базі VOXL 2 для польоту. Цей процес забезпечує безпечне та відгукнуто з&#39;єднання між вашим дроном та його системою керування.</p><p>Дотримуйтесь цього керівництва, щоб прив&#39;язати ваш приймач ELRS до вашого передавача.</p><h4 id="налаштування-відображення" tabindex="-1">Налаштування відображення <a class="header-anchor" href="#налаштування-відображення" aria-label="Permalink to &quot;Налаштування відображення&quot;">​</a></h4><ol><li><p><strong>Увімкніть приймач</strong>: Як тільки ваш квадрокоптер увімкнено, ви помітите, що синій світлодіод приймача ELRS мигає. Це свідчить про те, що отримувач увімкнений, але ще не встановив зв&#39;язок з передавачем.</p><p><img src="'+e+'" alt="Приймач Starling"></p></li><li><p><strong>Увійдіть в режим зв&#39;язку</strong>: Для ініціювання зв&#39;язку відкрийте термінал та виконайте команди <code>adb shell</code> та <code>voxl-elrs -bind</code>. Ви побачите, що світлодіод приймача перемикається на миготливий в режимі миттєвого реагування, сигналізуючи, що тепер він у режимі зв&#39;язку.</p><p><img src="'+o+'" alt="Boot Screenshot"></p></li></ol><h4 id="налаштування-передавача" tabindex="-1">Налаштування передавача <a class="header-anchor" href="#налаштування-передавача" aria-label="Permalink to &quot;Налаштування передавача&quot;">​</a></h4><ol><li><p><strong>Отримайте доступ до меню</strong>: На вашому передавачі радіо Commando 8, включеному в комплект, натисніть ліву кнопку режиму, щоб відкрити систему меню.</p><p><img src="'+l+'" alt="Натисніть Меню на ПДУ"></p></li><li><p><strong>Перейдіть до ExpressLRS</strong>: Використовуйте праву кнопку, щоб вибрати перший пункт меню, який повинен бути &quot;ExpressLRS.&quot;</p></li><li><p><strong>Знайдіть опцію Bind</strong>: Після вибору опції &quot;ExpressLRS&quot; прокрутіть вниз до нижньої частини меню, щоб знайти розділ &quot;Bind&quot;. Це можна зробити, натиснувши праву кнопку донизу, поки ви не досягнете опцію &quot;Прив&#39;язка&quot;.</p><p><img src="'+i+'" alt="Press Binding on RC"></p></li><li><p><strong>Ініціювати Прив&#39;язку</strong>: Виберіть &quot;Прив&#39;язати&quot;, щоб перевести передавач у режим прив&#39;язки. Ви будете знати, що процес був успішним, коли передавач видасть сигнал, вказуючи на успішне зв&#39;язування.</p></li></ol><h4 id="завершення-процесу-зв-язування" tabindex="-1">Завершення процесу зв&#39;язування <a class="header-anchor" href="#завершення-процесу-зв-язування" aria-label="Permalink to &quot;Завершення процесу зв&#39;язування&quot;">​</a></h4><p>Після того як передавач встановлено в режим зв&#39;язку, приймач ELRS на дроні змінить свій світлодіод з миготливого на постійне світло, що свідчить про успішне підключення між приймачем та передавачем.</p><ul><li><strong>Цикл живлення</strong>: Після завершення процесу прив&#39;язки обов&#39;язково вимкніть живлення VOXL 2 перед спробою політів. Це означає вимкнути VOXL 2, а потім увімкнути його знову. Цей крок забезпечує, що всі налаштування правильно застосовані і система визнає новостворене з&#39;єднання.</li></ul><p>Тепер ви повинні мати успішно прив&#39;язаний приймач ELRS до вашого передавача, готовий до використання з набором автономії PX4 від ModalAI. Безпечне підключення є важливим для надійної роботи вашого безпілотника, тому завжди підтверджуйте статус зв&#39;язку перед польотом.</p><h3 id="відео" tabindex="-1">Відео <a class="header-anchor" href="#відео" aria-label="Permalink to &quot;Відео&quot;">​</a></h3><ul><li><a href="https://youtu.be/M9OiMpbEYOg" target="_blank" rel="noreferrer">Огляд апаратного забезпечення VOXL 2 Starling</a></li><li><a href="https://youtu.be/Cpbbye3Z6co" target="_blank" rel="noreferrer">Посібник з першого польоту VOXL 2 Starling</a></li><li><a href="https://youtu.be/7OwGS-kcFVg" target="_blank" rel="noreferrer">VOXL 2 Starling Налаштування ELRS</a></li></ul>',31)]))}const X=s(c,[["render",m]]);export{q as __pageData,X as default};
